    [],nt"revision_timestamp": "2016-05-25T00:52:13.920093",nt"name": "air-traffic-control-radar-beacon",nt"isopen":
    true,nt"url": null,nt"notes": "The Air Traffic Control Radar Beacon (ATCRB)
    is a ground-based system that interrogates an airborne transponder and receives
    replies permitting a positive means of identifying airborne aircraft for air traffic
    control purposes.  This system provides secondary radar surveillance capability
    at airport surveillance radar (ASR) and air route surveillance radar (ARSR) sites
    to sustain the safe and efficient movement of aircraft.  This radar beacon is collocated
    with ARSR or ASR facilities.  ATCBI-6 equipment interrogates transponder equipped
    aircraft, receives their coded replies, decodes the replies, and provides digital
    information for air traffic control purposes.  ATCBI-6 systems provide a monopulse
    secondary surveillance radar (MSSR) capability for sustaining the safe and efficient
    movement of aircraft.  ATCBI-6M incorporates Mode-4 capability at joint surveillance
    system (JSS) sites only.  Mode-4 is used by DOD to identify aircraft as friend or
    foe (IFF).   RMM is incorporated int",nt"license_title": "Other License Specified",nt"extras":
